import React, { useState } from 'react'

export default function App() {
  const [count,setCount] = useState(0)
  const addOne=()=>{
    setCount(count+1)
  }
  return (
    <div>
      <h1> {count}</h1>
      <button onClick={addOne}>Add one</button>
      <button onClick={addOne}> one</button>

    </div>
  )
}
